pragma solidity ^0.6.0; 

contract Mapping 
{ 
    //Mappings
    //mappings are indexed from 1 
    //mappings are similar to a database 
    mapping(uint => string) public names; 

    constructor() public
    {
        names[1] = "Rohit"; 
        names[2] = "Sourish"; 
        names[3] = "Kahinee"; 
        names[4] = "Neha"; 
        names[5] = "Sayantan";
        names[6] = "Rik";
    }

}
